type: enum
name: LogLevelEnum
features: 打印日志等级
ignore: false
attributes:
  - name: V2TIM_LOG_NONE
    description: 不输出任何 sdk log
    value: 0
  - name: V2TIM_LOG_DEBUG
    description: 输出 DEBUG，INFO，WARNING，ERROR 级别的 log
    value: 3
