    description: 输出 INFO，WARNING，ERROR 级别的 log
    value: 4
  - name: V2TIM_LOG_WARN
    description: 输出 WARNING，ERROR 级别的 log
    value: 5
  - name: V2TIM_LOG_ERROR
    description: 输出 ERROR 级别的 log
    value: 6
